import styled from "styled-components";

export const ContactInfoContainer = styled.div`
  display: flex;
  flex-direction: column;
  font-family: var(--font-family-subtitle); 
  font-weight: 300;

  h2 {
    font-weight: 700;
    text-align: left;
    padding: 2rem;
  }

  .container {
    display: flex;

    .subcontainer {
      > p {
        display: flex;
        gap: 0.5rem;
        justify-content: center;
      }
    }

  }
`;
